  page = 0;
  pageSize = 9;
  monthlyData = {};
  isMonthlyDataVisible = {};
  // מצב הצגת הנתונים החודשיים
  selectedAvrech = {
    fullName: "",
    teudatZeut: "",
    dateOfBirth: null,
    street: "",
    houseNumber: "",
    phone: "",
    cellPhone: "",
    cellPhone2: "",
    bank: "",
    branch: "",
    accountNumber: "",
    status: "",
    datot: "",
    isPresent: "",
    id: 0
  };
  // אברך שנבחר לעדכון
  searchQuery = "";
  filterPresence = "";
  filterStatus = "";
  filterDatot = "";
  filteredAvrechim = [];
  lastName = "";
  firstName = "";
  constructor(myService, dialog) {
    this.myService = myService;
    this.dialog = dialog;
  }
  ngOnInit() {
    this.getAvrechim();
  }
  getAvrechim() {
    if (this.searchQuery || this.filterDatot || this.filterPresence || this.filterStatus) {
      this.myService.getSearchAvrech(this.searchQuery || "", this.filterPresence || "", this.filterDatot || "", this.filterStatus || "").subscribe((data) => {
        console.log("data", data);
        console.log("total", data.length);
        this.avrechim = data;
        this.totalAvrechim = data.length;
      });
    } else {
      this.myService.getAvrechim(this.page + 1, this.pageSize).subscribe((data) => {
        this.avrechim = data.avrechim;
        this.totalAvrechim = data.totalAvrechim;
      }, (error) => {
        console.error("Error loading data", error);
      });
    }
  }
  openAddAvrechDialog() {
    const dialogRef = this.dialog.open(AddAvrechDialogComponent, {
      width: "500px"
    });
    dialogRef.afterClosed().subscribe((result) => {
      console.log("\u05D4\u05E4\u05D5\u05E4-\u05D0\u05E4 \u05E0\u05E1\u05D2\u05E8");
    });
  }
  loadMonthlyData(id, year, month) {
    console.log("check", id, year, month);
    this.myService.GetMonthlyData(id, year, month).subscribe((data) => {
      console.log("Data received:", data);
      this.monthlyData[id] = data;
      this.isMonthlyDataVisible[id] = true;
      console.log("Monthly Data for ID", id, ":", this.monthlyData);
    }, (error) => {
      console.error("Error loading monthly data for id:", id, error);
      this.monthlyData[id] = [];
    });
  }
  pageChanged(event) {
    this.pageSize = event.pageSize;
    this.page = event.pageIndex;
    this.getAvrechim();
  }
